import React, { useState } from 'react';

import CategoryReport from '../components/CategoryReport';
import AdminForm from '../components/AdminForm';

import Users from '../components/Users';
import SwitchAdmin from '../components/SwitchAdmin/';

const Admin = () => {
  const [activeFrom, setActiveForm] = React.useState(true);
  console.log(activeFrom);
  return (
    <div className="root-adm">
      <div className="user-content">
        <div className="header">
          <CategoryReport />
        </div>
        <div className="switch">
          <SwitchAdmin value={activeFrom} onChangeButtons={(i) => setActiveForm(false)} />
        </div>
        <div className="user-container">
          <h4>Пользователи</h4>
          <Users />
          <Users />
          <Users />
        </div>
        <AdminForm />
      </div>
    </div>
  );
};

export default Admin;
